
def revers(nums):
    if len(nums) < 1:
        return True
    stack = []
    for i in nums:
        if i == '(' or i == '[' or i == '{':
            stack.append(i)
        elif i == ')' and len(stack) > 0 and stack.pop() == '(':
            continue
        elif i == ']' and len(stack) > 0 and stack.pop() == '[':
            continue
        elif i == '}' and len(stack) > 0 and stack.pop() == '{':
            continue
        else:
            return False
    return True if len(stack) == 0 else False

